import {Link} from "react-router-dom";
import Post from "./Post";

const Home = ({posts}) => {
    return (
        <>
        {
            posts.map((item)=>{
                return (
                    <div key={item.id}><Link to = "./post/1"><Post data={item}/></Link></div>
                )
            })
        }
        </>
    )
}

export default Home
